parsed caption:
Plenário do Senado Federal durante sessão especial destinada a celebrar o
aniversário de 17 anos da Lei Maria da Penha, principal instrumento jurídico
brasileiro de combate à violência doméstica.  
A Lei Maria da Penha leva o nome da farmacêutica Maria da Penha Maia
Fernandes, que ficou paraplégica após tentativa de feminicídio cometida pelo
seu marido. Ele respondeu em liberdade e só foi preso 20 anos depois. O caso
estimulou a apresentação de um projeto de lei sobre o tema, em 2004. O texto
virou lei dois anos depois.  
Mesa:  
procuradora da Mulher da Câmara dos Deputados, deputada Soraya Santos (PL-RJ);  
ministra de Estado das Mulheres, Cida Gonçalves;  
requerente desta sessão, senadora Leila Barros (PDT-DF);  
presidente do Senado Federal, senador Rodrigo Pacheco (PSD-MG);  
assessor técnico da Secretaria-Geral da Mesa, Iago Ruas Almeida Pereira;  
secretária-geral das Relações Exteriores, embaixadora Maria Laura Rocha;  
1ª coordenadora adjunta da Bancada Feminina da Câmara dos Deputados, deputada
Iza Arruda (MDB-PE);  
líder da Bancada Feminina do Senado Federal, senadora Daniella Ribeiro (PSD-
PB).  
Foto: Pedro França/Agência Senado
